import { Container, Image, Row, Col } from "react-bootstrap";
import Header from "../../components/Header";
import "./styles.css";

export default function HomeScreen() {
  return (
    <>
      <Header />
      <Container
        className="d-flex align-items-center justify-content-center flex-column"
        style={{ minHeight: "20vh" }}
      >
        <Row
          style={{ minHeight: "20vh", width: "100%" }}
          className="mt-4 mb-4 d-flex flex-row justify-content-between"
        >
          <Col md={6}>
            <div
              className="d-flex align-items-center justify-content-left p-2 cards-flowers flex-column"
              style={{
                backgroundImage:
                  "url(https://image.freepik.com/free-photo/beautiful-roses-bouquet-isolated-white-background_23-2147940338.jpg)",
              }}
            >
              <h3>Feliz día de las madres</h3>
              <span>
                Lorem ipsum dolor sit amet, consectetur adipiscing elit. Duis mi
                lectus, auctor eget lacus sit amet, lacinia tincidunt turpis.
                Aliquam ac lacinia dolor, sit amet imperdiet erat.
              </span>
            </div>
          </Col>
          <Col md={6}>
            <div
              className="d-flex align-items-center justify-content-left p-2 cards-flowers"
              style={{
                backgroundImage:
                  "url(https://image.freepik.com/free-photo/beautiful-roses-bouquet-isolated-white-background_23-2147940338.jpg)",
              }}
            >
              <h3>Sorprende a tu pareja</h3>
            </div>
          </Col>
        </Row>
        <h3>Pequeños detalles que alegran tu día</h3>
      </Container>
    </>
  );
}
